  `;

const Image = styled.div`
    width: 600px;
    height: 600px;
    margin: 15px;
     `;

    const TileTypeMiss = styled.div`
    display: flex;
    align-items: center;
    height: 30px;
    width: 80px;
    border-radius: 15px;
    border: 1px solid black;
    color: black;
    
    `;


export default function PokemonData() {
   
    return (
        <Qualquer>
           <Row>
      <Col span={12}>col-12</Col>
      <Col span={12}>col-12</Col>
    </Row>
        </Qualquer>
    );
    }
